import React from 'react';
import './App.css';

function App() {
  return (
    <div className="Background">
      <header className='Loginpage'>
        <p>Welcome!!!</p>
      </header>
      <header className='DarkSky'>
        <p>Good Day!!!</p>
      </header>
    </div>
  );
}

export default App;
